import styled from "styled-components";

const FrameChild = styled.div`
  height: 103.2px;
  width: 1248px;
  position: relative;
  background-color: var(--background);
  border-bottom: 1px solid var(--main-black);
  box-sizing: border-box;
  flex-shrink: 0;
  display: none;
`;
const Div = styled.div`
  position: relative;
  font-weight: 500;
  z-index: 1;
`;
const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: flex-start;
  padding: 0px var(--padding-xs) 0px 0px;
`;
const RectangleParent = styled.div`
  align-self: stretch;
  background-color: var(--background);
  border-bottom: 1px solid var(--main-black);
  overflow-x: auto;
  display: flex;
  flex-direction: row;
  align-items: flex-start;
  justify-content: space-between;
  padding: var(--padding-24xl) var(--padding-12xs) var(--padding-22xl)
    var(--padding-13xl);
  gap: var(--gap-xl);
`;
const Div1 = styled.div`
  width: 403px;
  position: relative;
  font-weight: 300;
  display: inline-block;
  flex-shrink: 0;
  min-width: 403px;
  max-width: 100%;
  @media screen and (max-width: 1050px) {
    flex: 1;
  }
  @media screen and (max-width: 750px) {
    min-width: 100%;
  }
`;
const Li = styled.li`
  margin-bottom: 12px;
`;
const Li1 = styled.li``;
const Ul = styled.ul`
  margin: 0;
  font-family: inherit;
  font-size: inherit;
  padding-left: var(--padding-2xl);
`;
const Div2 = styled.div`
  width: 362.7px;
  position: relative;
  font-weight: 300;
  display: inline-block;
  flex-shrink: 0;
  min-width: 362.7px;
  max-width: 100%;
  @media screen and (max-width: 1050px) {
    flex: 1;
  }
  @media screen and (max-width: 450px) {
    min-width: 100%;
  }
`;
const Text1 = styled.div`
  align-self: stretch;
  display: flex;
  flex-direction: row;
  align-items: flex-start;
  justify-content: flex-start;
  padding: 0px var(--padding-xl) 0px 0px;
  box-sizing: border-box;
  gap: 0px 44px;
  max-width: 100%;
  @media screen and (max-width: 1050px) {
    flex-wrap: wrap;
  }
  @media screen and (max-width: 450px) {
    gap: 0px 44px;
  }
`;
const TextIcon = styled.img`
  align-self: stretch;
  height: 0px;
  position: relative;
  max-width: 100%;
  overflow: hidden;
  flex-shrink: 0;
  object-fit: contain;
  z-index: 2;
`;
const Div3 = styled.div`
  height: 171px;
  width: 403px;
  position: relative;
  font-weight: 300;
  display: inline-block;
  flex-shrink: 0;
  min-width: 403px;
  max-width: 100%;
  @media screen and (max-width: 1050px) {
    flex: 1;
  }
  @media screen and (max-width: 750px) {
    min-width: 100%;
  }
`;
const TextParent = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: flex-start;
  gap: 35px 0px;
  max-width: 100%;
  @media screen and (max-width: 750px) {
    min-width: 100%;
  }
  @media screen and (max-width: 450px) {
    gap: 35px 0px;
  }
`;
const CookiesContainer = styled.div`
  height: 683px;
  width: 378.9px;
  position: relative;
  font-weight: 300;
  display: inline-block;
  flex-shrink: 0;
  min-width: 378.9px;
  max-width: 100%;
  @media screen and (max-width: 1050px) {
    flex: 1;
  }
  @media screen and (max-width: 450px) {
    min-width: 100%;
  }
`;
const Text2 = styled.div`
  align-self: stretch;
  display: flex;
  flex-direction: row;
  align-items: flex-start;
  justify-content: flex-start;
  gap: 0px 33px;
  max-width: 100%;
  @media screen and (max-width: 1050px) {
    flex-wrap: wrap;
  }
  @media screen and (max-width: 750px) {
    gap: 0px 33px;
  }
`;
const Vector = styled.div`
  align-self: stretch;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: flex-start;
  padding: 0px var(--padding-11xs) var(--padding-6xs) 0px;
  box-sizing: border-box;
  gap: 20px 0px;
  max-width: 100%;
`;
const Div4 = styled.div`
  height: 323px;
  width: 403px;
  position: relative;
  font-weight: 300;
  display: inline-block;
  flex-shrink: 0;
  min-width: 403px;
  max-width: 100%;
  @media screen and (max-width: 1050px) {
    flex: 1;
  }
  @media screen and (max-width: 450px) {
    min-width: 100%;
  }
`;
const DataSubjectInfo = styled.div`
  flex: 1;
  display: flex;
  flex-direction: row;
  align-items: flex-start;
  justify-content: flex-start;
  gap: 0px 44px;
  max-width: 100%;
  @media screen and (max-width: 1050px) {
    flex-wrap: wrap;
  }
  @media screen and (max-width: 750px) {
    min-width: 100%;
  }
  @media screen and (max-width: 450px) {
    gap: 0px 44px;
  }
`;
const Div5 = styled.div`
  width: 378.9px;
  position: relative;
  font-weight: 300;
  display: inline-block;
  flex-shrink: 0;
  min-width: 378.9px;
  max-width: 100%;
  @media screen and (max-width: 1050px) {
    flex: 1;
  }
  @media screen and (max-width: 450px) {
    min-width: 100%;
  }
`;
const Afooter = styled.div`
  align-self: stretch;
  display: flex;
  flex-direction: row;
  align-items: flex-start;
  justify-content: flex-start;
  padding: 0px var(--padding-11xs) 0px 0px;
  box-sizing: border-box;
  gap: 0px 59px;
  max-width: 100%;
  @media screen and (max-width: 1050px) {
    flex-wrap: wrap;
  }
  @media screen and (max-width: 750px) {
    gap: 0px 59px;
  }
`;
const FrameGroup = styled.div`
  align-self: stretch;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: flex-start;
  gap: 29px 0px;
  max-width: 100%;
`;
const FrameParentRoot = styled.div`
  align-self: stretch;
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  justify-content: flex-start;
  padding: 0px 0px var(--padding-17xl);
  box-sizing: border-box;
  gap: 52px 0px;
  max-width: 100%;
  text-align: left;
  font-size: var(--footer-size);
  color: var(--color-black);
  font-family: var(--footer);
  @media screen and (max-width: 750px) {
    gap: 52px 0px;
  }
`;

const FrameComponent1 = () => {
  return (
    <FrameParentRoot>
      <FrameGroup>
        <RectangleParent>
          <FrameChild />
          <Wrapper>
            <Div>Цель обработки персональных данных</Div>
          </Wrapper>
          <Div>Категории субъектов персональных данных</Div>
          <Div>Категории и перечень персональных данных</Div>
        </RectangleParent>
        <Vector>
          <Text2>
            <TextParent>
              <Text1>
                <Div1>
                  Для осуществления Обществом предпринимательской деятельности
                  в области электронной коммерции в качестве владельца
                  агрегатора информации о товарах (услугах) и путем
                  самостоятельной продажи товаров (оказания услуг) дистанционным
                  способом, в т. ч. с использованием сети «Интернет»; оказания
                  сопутствующих логистических услуг (организация доставки
                  товаров и осуществление складских операций), а также иной
                  обычной хозяйственной деятельности как юридического лица,
                  в т. ч. путем рекламирования себя, своих сервисов и услуг,
                  контроля качества использования своих сервисов и услуг
                  третьими лицами, организации пропускного и внутриобъектового
                  режимов, обеспечения безопасности посетителей на своей
                  территории, взаимодействия с субъектами персональных данных,
                  контрагентами и третьими лицами, в соответствии с действующим
                  законодательством РФ, уставом Общества, внутренними
                  документами и локальными нормативными актами Общества.
                </Div1>
                <Div2>
                  <Ul>
                    <Li>
                      Стороны, выгодоприобретатели или поручители по договорам,
                      включая, но не ограничиваясь, пользователей сервисов
                      и продуктов Общества, физических лиц, оказывающих услуги
                      Обществу, участников конкурсов, акций и т. д.;
                    </Li>
                    <Li>
                      Пользователи веб-сайтов и иных онлайн-сервисов Общества;
                    </Li>
                    <Li>
                      Представители контрагентов, государственных органов,
                      субъектов персональных данных и третьих лиц;
                    </Li>
                    <Li>Посетители территории Общества;</Li>
                    <Li1>
                      Иные субъекты персональных данных, каким-либо образом
                      взаимодействующие с Обществом в рамках заявленной цели.
                    </Li1>
                  </Ul>
                </Div2>
              </Text1>
              <TextIcon alt="" src="/text.svg" />
              <Text1>
                <Div3>
                  Для заключения и исполнения договоров с участием субъектов
                  персональных данных в качестве сторон, выгодоприобретателей
                  или поручителей по таким договорам, включая,
                  но не ограничиваясь, предоставление возможности использовать
                  сервисы и продукты Общества, выдачу призов и выплату
                  вознаграждений по итогам конкурсов и акций и т. д.
                </Div3>
                <Div2>
                  <Ul>
                    <Li>
                      Стороны, выгодоприобретатели или поручители по договорам,
                      включая, но не ограничиваясь, пользователей сервисов
                      и продуктов Общества, физических лиц, оказывающих услуги
                      Обществу, участников конкурсов, акций и т. д.;
                    </Li>
                    <Li1>
                      Пользователи веб-сайтов и иных онлайн-сервисов Общества.
                    </Li1>
                  </Ul>
                </Div2>
              </Text1>
            </TextParent>
            <CookiesContainer>
              <Ul>
                <Li>Гражданство;</Li>
                <Li>ФИО;</Li>
                <Li>Пол;</Li>
                <Li>Дата и место рождения;</Li>
                <Li>Данные документов, удостоверяющих личность;</Li>
                <Li>
                  Адрес регистрации по месту жительства и адрес фактического
                  проживания;
                </Li>
                <Li>
                  Контактная информация (номер телефона, факса, адрес
                  электронной почты, почтовый адрес);
                </Li>
                <Li>Банковские реквизиты;</Li>
                <Li>Реквизиты доверенностей;</Li>
                <Li>
                  ИНН, СНИЛС, ОГРНИП, идентификаторы пользователей сервисов
                  и продуктов Общества;
                </Li>
                <Li>Сведения о транспортных средствах;</Li>
                <Li1>
                  Регистрационные и авторизационные данные (логин, пароль
                  и т. д.), записи звонков (разговоров), технические сведения
                  о пользовательских устройствах и идентификаторы, в т. ч. файлы
                  cookies, информация о пользовательском местоположении,
                  сведения о приобретенных товарах (услугах) и иные данные,
                  самостоятельно предоставленные такими пользователями в адрес
                  Общества (в отношении пользователей веб-сайтов и иных
                  онлайн-сервисов Общества).
                </Li1>
              </Ul>
            </CookiesContainer>
          </Text2>
          <TextIcon alt="" src="/rectangle.svg" />
        </Vector>
        <Afooter>
          <DataSubjectInfo>
            <Div4>
              Для оформления и регулирования трудовых отношений Общества
              с субъектами персональных данных и иных непосредственно связанных
              с ними отношений, в том числе для исполнения обязательств
              и реализации прав сторон в рамках трудовых договоров между ними,
              включая, но не ограничиваясь, для расчета и выплаты заработной
              платы, направления субъектов персональных данных в командировки,
              для обеспечения безопасности субъектов персональных данных,
              Общества и третьих лиц, для контроля количества и качества
              выполняемой работы и обеспечения сохранности имущества субъектов
              персональных данных, Общества и третьих лиц, для получения
              субъектами персональных данных различных гарантий и льгот и т. д.
            </Div4>
            <Div2>
              <Ul>
                <Li>Работники Общества;</Li>
                <Li>Близкие родственники работников Общества;</Li>
                <Li>Бывшие работники Общества;</Li>
                <Li1>Кандидаты на замещение вакантных должностей Общества.</Li1>
              </Ul>
            </Div2>
          </DataSubjectInfo>
          <Div5>
            <Ul>
              <Li>Гражданство;</Li>
              <Li>ФИО;</Li>
              <Li>Пол;</Li>
              <Li>Дата и место рождения;</Li>
              <Li>Данные документов, удостоверяющих личность;</Li>
              <Li>Сведения, содержащиеся в документах миграционного учета;</Li>
              <Li>
                Адрес регистрации по месту жительства и адрес фактического
                проживания;
              </Li>
              <Li>
                Контактная информация (номер телефона, факса, адрес электронной
                почты, почтовый адрес);
              </Li>
              <Li>
                Данные документов об образовании, квалификации, профессиональной
                подготовке, сведения о повышении квалификации и иные аналогичные
                данные;
              </Li>
              <Li>
                Семейное положение, сведения о составе семьи и близких
                родственниках, которые могут понадобиться Обществу, в том числе,
                но не ограничиваясь, для предоставления работнику льгот,
                предусмотренных трудовым и налоговым законодательством РФ;
              </Li>
              <Li>
                Сведения о воинском учете и сведения, содержащиеся в документах
                воинского учета;
              </Li>
              <Li>
                Сведения, содержащиеся в трудовой книжке, сведения о трудовом
                стаже, предыдущих местах работы, доходах с предыдущих мест
                работы;
              </Li>
              <Li>ИНН, СНИЛС;</Li>
              <Li>Банковские реквизиты;</Li>
              <Li>
                Информация о приеме, переводе, увольнении и иных событиях,
                относящихся к трудовой деятельности работника у Общества;
              </Li>
              <Li>Сведения о доходах у Общества;</Li>
              <Li>
                Сведения о деловых и иных личных качествах, носящие оценочный
                характер;
              </Li>
              <Li>Биографические сведения;</Li>
              <Li>
                Сведения о временной нетрудоспособности и о состоянии здоровья;
              </Li>
              <Li1>Фото- и видеоизображения.</Li1>
            </Ul>
          </Div5>
        </Afooter>
      </FrameGroup>
      <TextIcon alt="" src="/consent-granted-by.svg" />
    </FrameParentRoot>
  );
};

export default FrameComponent1;
